import "./ChooseTripBtn.css";
const ChooseTripBtn = () =>{


    
    return(  
        <div className="bdy">        
            <div className="centre">
                <div>
                    <button className="btn">Join Trip</button>
                </div>
                <div>
                    <button className="btn" onClick={planTrip}>Plan Trip</button>
                </div>
            </div>
        </div>
 
    )
}

export default ChooseTripBtn;
